import React from 'react';
import './menu.css';
import Food from '../food/food';

export default function Menu(props) {
  return (
    <div className="Menu">
      {
        this.props.Food.map(Food => {
          return <Food Food={Food} key={Food.id} />
        })
      }
    </div>
  )
};
